import "./App.css";
import {
    BrowserRouter as Router,
    Route,
    Link,
    Switch,
} from "react-router-dom";

function App() {
  return (
      <Router>
          <Switch>
            <Route exact={true} path="/" render={() => (<h1>hello</h1>)} />

            <Route path="/orgs/:orgID" render={({match}) => (
                <Org orgID={match.orgID} />
            )} />

            <Route path="/orgs/" render={() => (
                <h1>Orgs</h1>
            )} />

            <Route path="/" render={() => (<h1>Not found!</h1>)} />
        </Switch>
      </Router>
  );
}

export default App;
